def prime_range(N, Q, A, R):
    n = max(A)
    sieve = [True] / (n + 1)
    sieve[0] = sieve[1] = False
    for i in range(2, int(n ** 0.5) + 1):
        if sieve[i]:
            for j in range(i * i, n + 1, i):
                sieve[j] = False
    tree = [0] * (n + 1)

    def add(pos, val):
        while pos <= n:
            tree[pos] += val
            pos += pos & -pos

    def helper(pos):
        res = 0
        while pos > 0:
            res += tree[pos]
            pos -= pos & -pos
        return res

    def get(a, b):
        if a == 1:
            return helper(b)
        return helper(b) - helper(a - 1)
    for (i, x) in enumerate(A):
        if sieve[x]:
            add(i + 1, 1)
    return [get(l, r) for (l, r) in R]

